import React from 'react';
import './App.css';
import { NotesList } from './components/NotesList';
import 'antd/dist/antd.css';
import NoteFrom from './components/NoteFrom';

function App() {
  return (
    <di>
      <div style={{marginLeft:'20px', padding:'50px 0px 20px 0px ',backgroundColor:'#5464fe' ,width:'340px',heigh:'30px'}}>

      </div>
      <div style={{margin :'20px' ,padding:'10px 20px 20px 20px ', backgroundColor:'#f4f6f8' ,width:'340px'}}>
        <NoteFrom></NoteFrom>
        <NotesList></NotesList>
      </div>
    </di>
  );
}

export default App;
